import 'bootstrap/dist/css/bootstrap.min.css';
import './Add.css';
import { Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import RetuRnCount from './Count';
import { IoIosAdd } from 'react-icons/io';
import { TweenMax, Expo } from 'gsap';

// Add viwer component 
export default function RetuRnAdd() {

 React.useEffect(() => {
  TweenMax.from('.wrp-add Button', 1, { delay: 1, opacity: 0, y: 30, ease: Expo.easeIn })

 }, [])

 return (
  <div className='wrp-add'>
   <div className='wrp-card'>
    <RetuRnCount />

   </div>

   <Link to='/add'>
    <Button style={{ width: '25vw' }}><IoIosAdd /> Nouveaux membre</Button>
   </Link>
  </div>
 );
};
